import './App.css';
import { useState } from 'react';

const App = () => {
  const [text, setText] = useState(0);

  const getText = () => {
    fetch('http://utils.mandakh.org:8000/utils/', {
      method: "POST",
      headers: {
        'Content-type': 'application/json',
      },
      body: JSON.stringify({
        action: "img2txt",
        lang: "mon+eng",
        img:     ""
    }),
    })
      .then((resp) => resp.json())
      .then((data) => {
        setText(data["data"]["action"]);
        setText(data["data"]["txt"]);
      })
      .catch((err) => {
        console.log(err.message);
      })
  }
  return (
    <div>
      <button className="py-3 px-6 sm:w-[60%] my-4" onClick={() => { getText() }}>Click convert</button>
      <div className='text'>{text}</div>
    </div>
  )
}
export default App;
